import React, { useState, useEffect } from 'react';
import api from '../../services/api';
import DataTable from '../shared/tables/DataTable';
import Button from '../shared/buttons/Button';
import { formatDate } from '../../utils/dateUtils';
import Select from '../shared/forms/Select';
import FormInput from '../shared/forms/FormInput';

const SalaryList = () => {
    const [salaries, setSalaries] = useState([]);
    const [loading, setLoading] = useState(true);
    const [filters, setFilters] = useState({
        month: new Date().getMonth() + 1,
        year: new Date().getFullYear(),
        showInactive: false
    });

    useEffect(() => {
        loadSalaries();
    }, [filters]);

    const loadSalaries = async () => {
        try {
            setLoading(true);
            const response = await api.get('/salaries', {
                params: {
                    month: filters.month,
                    year: filters.year,
                    showInactive: filters.showInactive
                }
            });
            setSalaries(response.data);
        } catch (error) {
            console.error('Error loading salaries:', error);
        } finally {
            setLoading(false);
        }
    };

    const columns = [
        { 
            key: 'sofer', 
            label: 'Șofer',
            render: (sofer) => (
                <div className="flex items-center">
                    <span>{sofer?.nume || '-'}</span>
                    {!sofer?.activ && (
                        <span className="ml-2 px-2 py-1 text-xs bg-gray-200 text-gray-700 rounded">
                            Inactiv
                        </span>
                    )}
                </div>
            )
        },
        { 
            key: 'luna', 
            label: 'Luna',
            render: (date) => formatDate(date, 'MMMM yyyy')
        },
        {
            key: 'salariuBaza',
            label: 'Salariu Bază',
            render: (value) => `${value} RON`
        },
        {
            key: 'diurna',
            label: 'Diurnă',
            render: (value) => value ? `${value} EUR` : '-'
        },
        {
            key: 'zileLucrate',
            label: 'Zile Lucrate',
            render: (value) => value || 0
        },
        {
            key: 'status',
            label: 'Status',
            render: (status) => (
                <span className={`px-2 py-1 rounded-full text-xs ${
                    status === 'Achitat' ? 'bg-green-100 text-green-800' :
                    status === 'Partial' ? 'bg-yellow-100 text-yellow-800' :
                    'bg-gray-100 text-gray-800'
                }`}>
                    {status}
                </span>
            )
        }
    ];

    const months = [
        { value: 1, label: 'Ianuarie' },
        { value: 2, label: 'Februarie' },
        { value: 3, label: 'Martie' },
        { value: 4, label: 'Aprilie' },
        { value: 5, label: 'Mai' },
        { value: 6, label: 'Iunie' },
        { value: 7, label: 'Iulie' },
        { value: 8, label: 'August' },
        { value: 9, label: 'Septembrie' },
        { value: 10, label: 'Octombrie' },
        { value: 11, label: 'Noiembrie' },
        { value: 12, label: 'Decembrie' }
    ];

    return (
        <div className="space-y-6">
            {/* Filtre */}
            <div className="bg-white p-4 rounded-lg shadow">
                <div className="grid grid-cols-1 md:grid-cols-4 gap-4">
                    <Select
                        label="Luna"
                        value={filters.month}
                        onChange={(e) => setFilters({...filters, month: parseInt(e.target.value)})}
                        options={months}
                    />
                    <FormInput
                        type="number"
                        label="An"
                        value={filters.year}
                        onChange={(e) => setFilters({...filters, year: parseInt(e.target.value)})}
                        min={2000}
                        max={2100}
                    />
                    <div className="flex items-center">
                        <label className="inline-flex items-center">
                            <input
                                type="checkbox"
                                className="form-checkbox h-5 w-5 text-blue-600"
                                checked={filters.showInactive}
                                onChange={(e) => setFilters({...filters, showInactive: e.target.checked})}
                            />
                            <span className="ml-2">Arată și șoferii inactivi</span>
                        </label>
                    </div>
                    <div className="flex justify-end">
                        <Button variant="primary" onClick={() => {}}>
                            Adaugă Salariu
                        </Button>
                    </div>
                </div>
            </div>

            {/* Tabel Salarii */}
            <div className="bg-white rounded-lg shadow">
                <DataTable
                    data={salaries}
                    columns={columns}
                    loading={loading}
                    onRowClick={() => {}}
                    actions={(salary) => (
                        <div className="flex space-x-2">
                            <Button
                                size="sm"
                                variant="secondary"
                                onClick={() => {}}
                            >
                                Detalii
                            </Button>
                            {salary.status !== 'Achitat' && (
                                <Button
                                    size="sm"
                                    variant="success"
                                    onClick={() => {}}
                                >
                                    Marchează Achitat
                                </Button>
                            )}
                        </div>
                    )}
                />
            </div>
        </div>
    );
};

export default SalaryList;
